import React from 'react'
import Name from './Name';
const Render = () => {
    const a=['virat','rohit','dhoni']
    const b=[{name:'Shashhwath',dob:2003},{name:'Shishu Sharma',dob:2004},{name:'Sanjay Raj',dob:2004}]
  return (
    <div>
    <ol>
      {a.map((a1)=>
      (
        <li>{a1}</li>
      ))}
      </ol>
      <ol>
        {
            b.map((b1)=>(
               <Name key={name} name={b1.name} dob={b1.dob}/>
            ))
        }
      </ol>
    </div>
  )
}

export default Render
